import React from 'react';
import './scss/FileName.scss';
import { Container, Row, Col } from 'react-grid-system';

function App() {
  return (
    <div className="App">
      <header className='header'>
        <a href='/' className='header_logo'></a>
      </header>
      <Container>
        <Row><div> </div></Row>
      </Container>
    </div>
  );
}

export default App;
